import{_ as e,o as t,c as a,O as s}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 19.2-392.10 (For contingent effective date see Acts 2021, Sp. Sess. I, cc. 524 and 542) Process for automatic sealing of offenses resulting in acquittal, nolle prosequi, or dismissal.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-392.10.md","filePath":"vacode/19.2-392.10.md"}'),o={name:"vacode/19.2-392.10.md"},i=s('<h1 id="§-19-2-392-10-for-contingent-effective-date-see-acts-2021-sp-sess-i-cc-524-and-542-process-for-automatic-sealing-of-offenses-resulting-in-acquittal-nolle-prosequi-or-dismissal" tabindex="-1">§ 19.2-392.10 (For contingent effective date see Acts 2021, Sp. Sess. I, cc. 524 and 542) Process for automatic sealing of offenses resulting in acquittal, nolle prosequi, or dismissal. <a class="header-anchor" href="#§-19-2-392-10-for-contingent-effective-date-see-acts-2021-sp-sess-i-cc-524-and-542-process-for-automatic-sealing-of-offenses-resulting-in-acquittal-nolle-prosequi-or-dismissal" aria-label="Permalink to &quot;§ 19.2-392.10 (For contingent effective date see Acts 2021, Sp. Sess. I, cc. 524 and 542) Process for automatic sealing of offenses resulting in acquittal, nolle prosequi, or dismissal.&quot;">​</a></h1><p>A. On at least a monthly basis, the Executive Secretary of the Supreme Court and any circuit court clerk who maintains a case management system that interfaces with the Department of State Police under subsection B1 of § <a href="/vacode/17.1-502/">17.1-502</a> shall provide an electronic list of all offenses in such case management system to the Department of State Police that were ordered to be automatically sealed pursuant to §§ <a href="/vacode/19.2-392.8/">19.2-392.8</a> and <a href="/vacode/19.2-392.9/">19.2-392.9</a>.</p><p>B. Upon receipt of the electronic lists under subsection A, the Department of State Police shall proceed as set forth in § <a href="/vacode/19.2-392.13/">19.2-392.13</a>.</p><p>2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0524" target="_blank" rel="noreferrer">524</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0542" target="_blank" rel="noreferrer">542</a>.</p>',4),n=[i];function r(c,l,f,d,p,u){return t(),a("div",null,n)}const _=e(o,[["render",r]]);export{m as __pageData,_ as default};
